import React, { Component } from "react";
import Card from "./Card";

export class List extends Component {


	render() {
		const { name } = this.props;
		return (
			<div className="bg-gray-200 flex-shrink-0 flex-column w-60 m-5 px-2 pb-7 pt-3">
				<div>{name}</div>
				<Card />
			</div>
		);
	}
}

export default List;
